INSERT INTO `sousactivite` VALUES ('1',' ','Mariage',' : 1.000 \n','Le montant de la subvention est de 1 000 dirhams.','1','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/marriage.svg'),('10',' ','Estivage',' :\n           \n      \n 10   Hacienda     )100  )\n 3  Oumaya  )120  )\n 1      )150  )\n 6  Caricia  )150    1 200    2\n :\n           \n       \n   :\n          %55  %65\n      .     \n  :\n65%-       6  10\n55%-       11  ','Appartements de l\'association :\nL\'association propose des appartements de vacances mis  la disposition des membres  des prix trs avantageux tout au long de l\'anne et rpartis comme suit :\n\n10 appartements au centre \"Hacienda\"  Sadia - Nouvelle (100 dirhams par jour)\n3 appartements \"Oumaya\"  Martil (120 dirhams par jour)\n1 appartement \"Sahb Al Dahab\"  Rabat (150 dirhams par jour)\n6 appartements \"Caricia\"  Marrakech (150 dirhams par jour pour la catgorie 1 et 200 dirhams par jour pour la catgorie 2)\nLocation d\'appartements :\nDes accords sont conclus annuellement pendant la priode estivale avec des centres de vacances privs et des agences touristiques pour rpondre aux demandes de vacances des membres de l\'association.\n\nSoutien financier pour la location d\'appartements :\nLa contribution de l\'association au loyer des appartements pour les membres varie entre 55 % et 65 %, les membres tant responsables du reste des frais. La contribution de l\'association est rpartie comme suit :\n\n65 % pour les employs classs dans les chelons de salaire de 6  10\n55 % pour les employs classs dans les chelons de salaire de 11 et plus','4','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/Estivage.svg'),('11','     ','Zoo','           \n   )   33% 40% (      \n    10 \n :\n20   10  ','Dans le cadre d\'un partenariat avec la Socit du Parc National des Animaux, l\'association obtient des billets  prix rduits (rduction allant de 33 %  40 %), puis soutient chaque billet par une contribution de 10 dirhams. Voici les prix des billets :\n\n20 dirhams pour les adultes\n10 dirhams pour les enfants','2','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/Zoo.svg'),('12','       ','Excursion','                ','L\'association labore un programme annuel afin de fournir ce type de services selon la demande, sous rserve de la participation active des membres.','2','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/Excursion.svg'),('13','    ','Naissance',' : 1.000   3000     ( \n         )','Le montant de la subvention est de 1 000 dirhams par nouveau-n et de 3 000 dirhams pour une mre de jumeaux. Cette subvention est prise en charge par la compagnie d\'assurance Saham dans le cadre de l\'accord d\'assurance complmentaire sant.','1','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/baby.svg'),('14','  ','Rentre scolaire.','          5 \n10           \n        \n    :\n 500    \n 900    \n 1300    ','\nL\'Association des Affaires Sociales accorde aux membres classs dans les tranches de salaires de 5  10 une subvention pour chaque enfant scolaris  un niveau d\'enseignement primaire, secondaire ou secondaire, dans la limite de trois enfants par adhrent bnficiaire. Le montant de la subvention est dtermin comme suit :\n\n500 dirhams par enfant\n900 dirhams pour deux enfants\n1300 dirhams pour trois enfants','1','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/backtoSchool.svg'),('15','   ','Soutien linguistique.','.  : 50%      600   ','Une aide financire quivalente  50% des frais de soutien, dans la limite de 600 dirhams par session.','1','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/SoutienLang.svg'),('16','   ','Restauration','  :\n        :\n       \n      )  )\n      \n      )  )\n    : 10      \n','Les restaurants des services centraux :\nLe ministre dispose de quatre restaurants rpartis comme suit :\n\nUn restaurant au sige central dans le quartier administratif de Rabat Chellah.\nUn restaurant dans le quartier Riyadh  la cit Riyadh (en cours de rnovation).\nUn restaurant dans le quartier Riyadh, rue Kamal Zebdi.\nUn restaurant  la Direction des Ressources Humaines  Mabiala (en cours de rnovation).\nMontant de la subvention pour chaque restaurant : 10 dirhams par repas par jour.','1','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/resturant.svg'),('17','  ','Adhsion','hhh','hhhh','1','https://github.com/osamalmezouari/AOS/blob/master/frontend/public/assets/images/inscreption.svg'),('2',' ','Plerinage','                                                        25000    20000  .        ','Dans le cadre de l\'accord conclu entre l\'association et l\'administration du ministre de l\'Industrie et du Commerce,\n\nl\'Association des Affaires Sociales du Ministre de l\'Industrie, du Commerce et de la Technologie moderne alloue une contribution financire pour aider  couvrir les cots lis au plerinage pour tous les membres, employs et retraits, slectionns par tirage au sort dans toutes les rgions, afin d\'accomplir le devoir du Hajj chaque anne.\n\nCette contribution s\'lve  25 000 dirhams pour les membres employs et  20 000 dirhams pour les membres retraits.\n\nChaque membre bnficie de cette contribution une seule fois dans sa vie.\n','1','https://raw.githubusercontent.com/osamalmezouari/AOS/ec9085894c38392f1e8803ad83bd81c1026757ec/frontend/public/assets/images/makah.svg'),('3','  ','Prts','           .','Au moins une fois par an, des prts sociaux sont octroys aux membres de l\'association.','1','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/moneysalaf.svg'),('4',' ','Retrait','                        51                          ','L\'Association des Affaires Sociales du Ministre de l\'Industrie, du Commerce et des Technologies modernes accorde  ses membres une allocation financire lors de leur dpart  la retraite aprs avoir atteint l\'ge lgal. Cette allocation s\'lve  51 000 dirhams en reconnaissance des services louables qu\'ils ont rendus tout au long de leur carrire dans le secteur. De plus, un vnement annuel est organis en l\'honneur des retraits, lors duquel cette allocation ainsi que des plaques commmoratives leur sont remises.','1','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/grandfather.svg'),('5','     ','Maladie','           \n      \n  :   3.000  10.000    ','\nCertaines demandes d\'aide financire des membres sont prises en charge pour couvrir les cots de traitement dans des cas de maladies graves et coteuses. Le montant de l\'aide varie entre 3 000 et 10 000 dirhams selon la nature de la maladie.','1','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/sick.svg'),('6','','Condolance','   :\n2.000       \n5.000   ()   ()   \n5.000  () () ()  ()\n10.000  () () () () ','\nUne aide financire est accorde comme suit :\n\n2 000 dirhams pour le membre du personnel en cas de dcs d\'un parent.\n5 000 dirhams pour le membre du personnel en cas de dcs du conjoint ou d\'un enfant.\n5 000 dirhams pour le conjoint survivant du membre du personnel retrait.\n10 000 dirhams pour le conjoint survivant du membre du personnel dcd qui exerce une activit professionnelle.','1','https://upload.wikimedia.org/wikipedia/commons/thumb/c/c9/%D8%A5%D9%86%D8%A7_%D9%84%D9%84%D9%87_%D9%88%D8%A5%D9%86%D8%A7_%D8%A5%D9%84%D9%8A%D9%87_%D8%B1%D8%A7%D8%AC%D8%B9%D9%88%D9%86.jpg/1200px-%D8%A5%D9%86%D8%A7_%D9%84%D9%84%D9%87_%D9%88%D8%A5%D9%86%D8%A7_%D8%A5%D9%84%D9%8A%D9%87_%D8%B1%D8%A7%D8%AC%D8%B9%D9%88%D9%86.jpg'),('7','  ','Couverture complmentaire','       SAHAM    542 \n       \n          \n        \n    (     )','\nDans le cadre de l\'accord conclu avec la compagnie d\'assurance \"SAHAM\", un montant de 542 dirhams est vers chaque anne pour chaque employ en change du service d\'assurance complmentaire. Cette convention permet aux employs de rcuprer une partie des frais engags en cas de maladie, de chirurgie, de maladies chroniques de longue dure, de maladies graves et coteuses, ainsi que dans certains cas particuliers (veuillez vous rfrer au guide de l\'assurance complmentaire).','3','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/covertureSante.svg'),('8','     ','Examen mdical','        (   \n         \n)\n   27.000      20.000  \n         \n','Le sige du ministre dispose d\'une clinique mdicale gratuite avec deux mdecins (le Dr Alami spcialis en mdecine interne  l\'hpital Ibn Sina et le Dr Aloui spcialis en dermatologie). Un montant de 27 000 dirhams est vers annuellement au Dr Alami et un montant de 20 000 dirhams est vers annuellement au Dr Aloui en change des services de consultation mdicale et de conseils dispenss aux membres de l\'association.','3','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/ConsultationMaladie.svg'),('9','    ','Centres langues trangres','          \n         :\n   (Workshop Language The (   \n   25%       \n   (Cervantes Instituto (    \n  15%    \n   (Franais Institut (    \n  20%        ','\nEn plus de l\'aide financire fournie par l\'association dans le cadre du soutien scolaire pour les cours de langue, des contrats ont t conclus avec trois centres  Rabat :\n\nL\'Institut de langue anglaise \"Workshop Language The\"  Rabat pour bnficier d\'une rduction de 25 % sur le tarif gnral et des frais d\'inscription gratuits.\nL\'Institut de langue espagnole \"Cervantes Instituto\"  Rabat pour obtenir une rduction de 15 % sur le tarif gnral.\nL\'Institut de langue franaise \"Franais Institut\"  Rabat pour bnficier d\'une rduction de 20 % sur le tarif gnral et d\'un test de niveau gratuit.','4','https://raw.githubusercontent.com/osamalmezouari/AOS/master/frontend/public/assets/images/langCentre.svg');
